import styled from "styled-components";
import { NumberSymbol } from "@styled-icons/fluentui-system-regular/NumberSymbol";

const Container = styled.ul`
    display: flex;
    flex-direction: column;
    justify-content: left;
    padding: 0;
`;

const Item = styled.li`
    width: 200px;
    background-color: saddlebrown;
    list-style: none;
    display: flex;
    align-items: center;
    justify-content: left;
    font-size: 1.2rem;
`;

const Sharp = styled(NumberSymbol)`
    width: 30px;
    height: 30px;
    margin-right: 10px;
`;

function NavItem() {
    const ItemText = [
        { icon: Sharp, text: "Home" },
        { icon: Symbol, text: "Explore" },
        { icon: Symbol, text: "Notifications" },
        { icon: Symbol, text: "Messages" },
        { icon: Symbol, text: "Bookmarks" },
        { icon: Symbol, text: "Lists" },
        { icon: Symbol, text: "Profile" },
        { icon: Symbol, text: "More" },
    ];

    return (
        <Container>
            {ItemText.map((item, index) => (
                <Item>
                    <item.icon />
                    {item.text}
                </Item>
            ))}
        </Container>
    );
}

export default NavItem;
